import React from 'react';
import './SkeletonLoader.css';

const SkeletonLoader = () => {
  const rows = Array(20).fill(0); // Array for 20 skeleton rows

  return (
    <>
      {rows.map((_, index) => (
        <tr key={index} className="skeleton-row">
          <td className="skeleton skeleton-number"></td>
          <td className="skeleton skeleton-coin-info"></td>
          <td className="skeleton skeleton-chart"></td>
          <td className="skeleton skeleton-price"></td>
          <td className="skeleton skeleton-change"></td>
          <td className="skeleton skeleton-volume"></td>
          <td className="skeleton skeleton-marketcap"></td>
          <td className="skeleton skeleton-buy"></td>
        </tr>
      ))}
    </>
  );
};

export default SkeletonLoader;
